    private List<BlazorApp1.Data.Tarea> tareas;

    protected override async Task OnInitializedAsync()
    {
        tareas = await TareaService.ListadoTareas();
    }

    protected void Editar(int id)
    {
        navigation.NavigateTo("Tareas/Editar/" + id);
    }

    async Task Borrar(int id)
    {
        bool confirmed = await JsRuntime.InvokeAsync<bool>("confirm", "Desea elimiar la Tarea?");
        if (confirmed)
        {
            await TareaService.DeleteTarea(id);
            tareas = await TareaService.ListadoTareas();
        }
    }

